// DeleteUniqueIndexCache 删除索引存在的缓存
func (m *MallPaymentRecordRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.MallPaymentRecord) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, m.cache.Key(CacheMallPaymentRecordByConditionPrefix))
	keys = append(keys, m.cache.Key(CacheMallPaymentRecordUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[m.cache.Key(CacheMallPaymentRecordByIDPrefix, item.ID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallPaymentRecordUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallPaymentRecordByTransactionIDPrefix, item.TransactionID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallPaymentRecordUnscopedByTransactionIDPrefix, item.TransactionID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallPaymentRecordByOrderIDPrefix, item.OrderID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallPaymentRecordUnscopedByOrderIDPrefix, item.OrderID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallPaymentRecordByPaymentStatusPrefix, item.PaymentStatus)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallPaymentRecordUnscopedByPaymentStatusPrefix, item.PaymentStatus)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallPaymentRecordByThirdPartyOrderNoPrefix, item.ThirdPartyOrderNo)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallPaymentRecordUnscopedByThirdPartyOrderNoPrefix, item.ThirdPartyOrderNo)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := m.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
